            {qrsize && <QRcode size={87} value={"https://wa.me/886975139873"} />}
            <StyledLink target='_self' href="https://wa.me/886975139873"><Styledicon src={whats} /></StyledLink>
            </StyledInnerGrouping>
            </StyledInnerContainer>
            <StyledInnerContainer>
            <StyledInnerGrouping>
            {qrsize && <QRcode size={87} value={"https://twitter.com/CryptoOwl3"} />}
            <StyledLink target='_self' href="https://twitter.com/CryptoOwl3"><Styledicon src={twitter} /></StyledLink>
            </StyledInnerGrouping>
            <HorizontalSpacer />
            <StyledInnerGrouping>
            {qrsize && <QRcode size={87} value={"87daysofsam@gmail.com"} />}
            <StyledLink target='_self' href="mailto:87daysofsam@gmail.com">Email</StyledLink>
            </StyledInnerGrouping>
            </StyledInnerContainer>
        </StyledContainer>
    )
}

